import React, { useState, useMemo, useEffect, useCallback } from 'react';
import { Select, Radio, Button, Form } from 'antd';
import Modal from '../../common/modal/Modal';
import i18n from '../locales';
import { Ontology, Instance, CategoryInstancesMap } from '../types';
import { formatFrames } from '../utils';
import './InstanceMove.scss';

interface InstanceMoveProps {
  ontology: Ontology[];
  currentFrame: number;
  activeInstanceId: string;
  instances: {[instanceId: string]: Instance};
  categoryInstancesMap: CategoryInstancesMap;
  onMove: (instanceId: string, targetCategory: string, targetNumber: number, frames: number[]) => void;
  onClose: () => void;
  getInstanceLabel: (instance: Instance) => string;
}

function getFramesByType(frames: number[], currentFrame: number, type: 'current' | 'following' | 'all') {
  switch (type) {
    case 'current':
      return [currentFrame];
    case 'following':
      return frames.slice(frames.indexOf(currentFrame));
    case 'all':
      return [...frames];
    default:
      return [];
  }
}

const InstanceMove = ({
  ontology,
  currentFrame,
  activeInstanceId,
  instances,
  categoryInstancesMap,
  onMove,
  onClose,
  getInstanceLabel,
}: InstanceMoveProps) => {
  const [category, setCategory] = useState('');
  const [number, setNumber] = useState<number | undefined>();
  const [applyType, setApplyType] = useState<'current' | 'following' | 'all'>('current');
  const [numberError, setNumberError] = useState('');

  useEffect(() => {
    setCategory(instances[activeInstanceId].category);
    setNumber(undefined);
    setApplyType('current');
  }, [activeInstanceId]); // when instance changes, reset all values

  useEffect(() => {
    setNumber(undefined);
    setApplyType('current');
  }, [category]);

  const supportedNumbers = useMemo(() => {
    if (!category || !categoryInstancesMap[category]) {
      return [];
    }
    return Object.values(categoryInstancesMap[category])
      .filter((num) => category !== instances[activeInstanceId].category || num !== instances[activeInstanceId].number)
      .sort((a, b) => a - b);
  }, [category]); // when category changes, change supported numbers

  const [allFrames, overwrittenFrames] = useMemo(() => {
    if (number !== undefined) {
      const instanceFrames = Object.keys(instances[activeInstanceId].frames).map((f) => parseInt(f, 10));
      const overlappedFrames: number[] = [];
      if (number >= 0) {
        const targetInstanceId = Object.keys(categoryInstancesMap[category]).find((id) => categoryInstancesMap[category][id] === number);
        if (targetInstanceId) {
          const targetInstance = instances[targetInstanceId];
          instanceFrames.forEach((frameIndex) => {
            if (targetInstance.frames[frameIndex]) { // exists
              overlappedFrames.push(frameIndex);
            }
          });
        }
      }
      return [instanceFrames, overlappedFrames];
    }
    return [[], []];
  }, [number]); // when number changes, change frames can be applied to

  const handleSave = () => {
    if (number === undefined) {
      setNumberError(i18n.translate('MOVE_NO_OBJECT_WARNING'));
      return;
    }
    onMove(
      activeInstanceId,
      category,
      number,
      getFramesByType(allFrames, currentFrame, applyType),
    );
  };

  const renderRadioOption = useCallback((type: 'current' | 'following' | 'all') => {
    let overlappings = [...overwrittenFrames];
    if (type === 'current') {
      overlappings = overwrittenFrames.indexOf(currentFrame) >= 0 ? [currentFrame] : [];
    } else if (type === 'following') {
      const index = overwrittenFrames.findIndex((frame) => frame >= currentFrame);
      if (index >= 0) {
        overlappings = overwrittenFrames.slice(index);
      } else {
        overlappings = [];
      }
    }
    return (
      <Radio key={type} className="radio-option" value={type}>
        {type === 'current' && i18n.translate('MOVE_APPLY_CURRENT_FRAME')}
        {type === 'following' && i18n.translate('MOVE_APPLY_FOLLOWING_FRAMES')}
        {type === 'all' && i18n.translate('MOVE_APPLY_ALL_FRAMES')}
        {formatFrames(getFramesByType(allFrames, currentFrame, type))}
        {overlappings.length > 0 && i18n.translate('MOVE_OVERLAP_WARNING', { values: { overlaps: formatFrames(overlappings) } })}
      </Radio>
    );
  }, [allFrames]);

  return (
    <Modal
      className="instance-move"
      visible
      title={i18n.translate('MOVE_TITLE')}
      onClose={onClose}
    >
      <div>{i18n.translate('MOVE_TO_LABEL', { values: { object: getInstanceLabel(instances[activeInstanceId]) } })}</div>
      <div style={{ margin: '16px 0 8px 0' }}>{i18n.translate('MOVE_CLASS_LABEL')}</div>
      <Form.Item>
        <Select
          style={{ width: 332 }}
          value={category}
          onChange={setCategory}
        >
          {ontology.map((o) => (
            <Select.Option key={o.class_name} value={o.class_name}>
              {o.display_name || o.class_name}
            </Select.Option>
          ))}
        </Select>
      </Form.Item>
      <div style={{ margin: '16px 0 8px 0' }}>{i18n.translate('MOVE_OBJECT_LABEL')}</div>
      <Form.Item {...numberError && { validateStatus: 'error', help: numberError }}>
        <Select
          style={{ width: 332 }}
          value={number}
          onChange={(v) => {
            setNumber(v as number);
            setNumberError('');
          }}
        >
          <Select.Option value={-1}>
            <div style={{ textAlign: 'center' }}>{i18n.translate('MOVE_CREATE_ID')}</div>
          </Select.Option>
          {supportedNumbers.map((num) => (
            <Select.Option key={num} value={num}>
              {num}
            </Select.Option>
          ))}
        </Select>
      </Form.Item>
      {allFrames.length > 0 && (
        <div style={{ marginTop: 16 }}>
          <Radio.Group
            style={{ width: '100%' }}
            value={applyType}
            onChange={(e) => setApplyType(e.target.value)}
          >
            {['current', 'following', 'all'].map((t) => renderRadioOption(t as 'current' | 'following' | 'all'))}
          </Radio.Group>
        </div>
      )}
      <div style={{ marginTop: 45, textAlign: 'right' }}>
        <Button type="primary" style={{ width: 80 }} onClick={handleSave}>
          {i18n.translate('COMMON_SAVE')}
        </Button>
      </div>
    </Modal>
  );
};

export default InstanceMove;
